import React from "react";
import { Box, AppBar, ThemeProvider, Typography, createTheme, Fab, Grid, TextField } from "@mui/material";
import { Unstable_Popup as BasePopup } from '@mui/base/Unstable_Popup';
import AddIcon from "@mui/icons-material/Add";

// import { pageTheme } from "./assets/PageTheme";

import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  const [anchor, setAnchor] = React.useState<null | HTMLElement>(null);

  const handleClick = (event: React.MouseEvent<HTMLElement>) => {
    setAnchor(anchor ? null : event.currentTarget);
  };

  const open = Boolean(anchor);
  const id = open ? 'simple-popper' : undefined;

  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <Box>
        <AppBar sx={{ p: 2 }} >
          <Grid container sx={{ display: "flex", alignItems: 'center', }}>
            <Grid xs={11}>
              <Typography variant="h4" component="h1" sx={{ p: 2 }}>
                Audio Player for Streamed Content
              </Typography>
            </Grid>
            <Grid xs>
              <SpeedDial
                ariaLabel="SpeedDial basic example"
                sx={{ position: 'absolute', bottom: 16, right: 16 }}
                icon={<AddIcon />}
              >
                {actions.map((action) => (
                  <SpeedDialAction
                    key={action.name}
                    icon={action.icon}
                    tooltipTitle={action.name}
                  />
                ))}
              </SpeedDial>
              {/* <Fab color="default" aria-label="add" onClick={handleClick}>
                <AddIcon />
              </Fab> 
              <BasePopup id={id} open={open} anchor={anchor}>
                <TextField id="outlined-basic" label="Outlined" variant="outlined" />
              </BasePopup> */}
            </Grid> 
          </Grid>        
        </AppBar>
      </Box>
    </ThemeProvider>
  );
}

export default App;
